import React from "react";
import "./home.css";
const Home = () => {
  return (
    <div>
      <header>
        <div className="div-header">
          <h1>ParkSys</h1>
          <h3>Seu gerenciamento de veiculos</h3>
        </div>
      </header>
    </div>
  );
};

export default Home;
